const OptionsStyle = {
  body: {
    display: "block",
    backgroundColor: "#555",
    width: "150px",
    height: "100px",
    position: "relative",
    left: "31%",
    bottom: "450px",
    borderRadius: "0px 5px 5px 5px",
  },
  ul: {
    listStyle: "none",
    paddingLeft: "10px",
  },
  li: {
    paddingLeft: "0px",
    textAlign: "left",
    paddingTop: 5,
    cursor: "pointer",
    color: "white",
  },
};

export default OptionsStyle;
